import {
	UPDATE_TAC_WETH_PAIR,

} from '../constants/Uniswap';


const initState = {
  USDCTACpair: null,
}

const uniswap = (state = initState, action) => {
	switch (action.type) {
		case UPDATE_TAC_WETH_PAIR:
			return {
				...state,
				payload: action.payload,
			}
		default:
			return state;
	}
}

export default uniswap
